    "import matplotlib.pyplot as plt\n",
    "from sklearn.preprocessing import MinMaxScaler\n",
    "\n",
    "# Function to scale back the predicted closing prices\n",
    "def inverse_scale(target_scaler, y_pred_scaled):\n",
    "    y_pred = target_scaler.inverse_transform(y_pred_scaled.reshape(-1, 1)).flatten()\n",
    "    return y_pred\n",
    "\n",
    "# Get the ticker you want to plot\n",
    "ticker_to_plot = 'AAPL'\n",
    "\n",
    "# Get the scaled data for the specific ticker\n",
    "scaled_df = scaled_sp500_data[ticker_to_plot]\n",
    "original_df = sp500_data[ticker_to_plot]\n",
    "\n",
    "# Separate features and target variable\n",
    "X = scaled_df.drop(columns=['Close'])\n",
    "y = scaled_df['Close']\n",
    "\n",
    "# Get the model for the specific ticker\n",
    "model = models[ticker_to_plot]['model']\n",
    "\n",
    "# Get the scaler for the target variable\n",
    "target_scaler = MinMaxScaler()\n",
    "target_scaler.fit(original_df[['Close']])\n",
    "\n",
    "# Make predictions\n",
    "y_pred_scaled = model.predict(X.values)\n",
    "\n",
    "# Invert the scaling to obtain original closing prices\n",
    "y_pred = inverse_scale(target_scaler, y_pred_scaled)\n",
    "\n",
    "# Ensure the lengths match\n",
    "if len(original_df.index) != len(y_pred):\n",
    "    # If the prediction array is longer, trim it\n",
    "    y_pred = y_pred[:len(original_df.index)]\n",
    "\n",
    "\n",
    "# Plot the actual closing prices against the predicted closing prices\n",
    "plt.figure(figsize=(10, 6))\n",
    "plt.plot(original_df.index, original_df['Close'], label='Actual Closing Prices', color='blue', linestyle='-')\n",
    "plt.plot(original_df.index, y_pred, label='Predicted Closing Prices', color='red', linestyle='-')\n",
    "plt.title(f\"Actual vs Predicted Closing Prices for {ticker_to_plot}\")\n",
    "plt.xlabel(\"Time\")\n",
    "plt.ylabel(\"Closing Price\")\n",
    "plt.legend()\n",
    "plt.grid(True)\n",
    "plt.show()\n"
